import React, { useEffect } from 'react';
import '../css/Map.css';

function Map() {
    useEffect(() => {
        // 네이버 지도 API 호출
        const script = document.createElement('script');
        script.src = 'https://openapi.map.naver.com/openapi/v3/maps.js?ncpClientId=gk52oscuby'; // 여기에 클라이언트 ID를 입력하세요
        script.async = true;
        script.onload = () => {
            // API 로드 후 실행될 함수
            const map = new window.naver.maps.Map('map', {
                center: new window.naver.maps.LatLng(36.3646712, 127.3587861),
                zoom: 7
            });
        };
        document.body.appendChild(script);

        return () => {
            // 컴포넌트가 언마운트 될 때 스크립트 제거
            document.body.removeChild(script);
        };
    }, []);

    return (
        <div id="map" style={{ width: '600px', height: '450px' }}></div>
    );
}

export default Map;
